import React from 'react'
import homepic from '../assets/homepic.png'
import Mask from '../assets/mask-image.png'; // Replace with the path to your wave mask image
function Home() {

    const hometext = {
        fontFamily: 'ITC Franklin Gothic LT', 
        fontSize: '55px', 
        marginTop: '180px',
        marginLeft:'150px',
        whiteSpace: 'pre-line', // Allow line breaks
        fontWeight:'bold'
    };
    const homepicture = {
        width: '600px',
        height: '400px',
        borderRadius: '15% 20% 25% 30% / 30%', // Curved shape with a slight vertical cutoff
        overflow: 'hidden', // Hide overflow to maintain the curved shape

        border: '15px solid #63821b', // Border color and thickness
      };
  return (
    <div className="home">
        <div style = {hometext}>Changing the Face of {'\n'}Irish Food Education</div>
        <div><img src={homepic} alt="homepic" style={homepicture} /></div>
    </div>

  )
}

export default Home
